import './App.css';
import Section from './components/section/Section'

const todoData = [
  { todo: "Bug Grocery" },
  { todo: "Send Email" },
  { todo: "Finish Assignment" },
  { todo: "Write Blog" },
  { todo: "Bake Cake" },
];

function App() {
  return (
    <div>
      <Section todo={todoData} />
    </div>
  )
}

export default App;
